const tar = require('tar-stream')
const gunzip = require('gunzip-maybe')
const concat = require('concat-stream')
const buf2stream = require('buffer-to-stream')
const mb = require('multibase')

var tars = [
  // "",
  "",
]

tars.map((tar1) => {
  var e = tar.extract()
  e.on('entry', (header, stream, next) => {
    console.log(header)
    stream.pipe(concat((data) => {
      next()
    }))
  })
  e.on('error', console.log)
  e.on('finish', console.log)


  var buf = mb.decode(tar1)
  var tar2 = mb.encode('base64', buf)
  console.log('equal?', tar1 == tar2)

  buf2stream(buf).pipe(gunzip()).pipe(e)
})
